import { useState } from 'react';

function Home()
{
    return( 
            <div>
                <h1>Home</h1>
            </div> 
    )
}


function Contador()
{
    const [contador, setContador] = useState(1);

    function adcionarContador()
    {
        setContador(contador + 1)
    }
}
export default Home
